function generate(){$.ajax({url:"generate.php",dataType:"text",data:{data:JSON.stringify(userMap)},success:function(e){console.log(e);var t=$.parseJSON(e);console.log(t),window.location="usermaps/"+t}})}var countryName=[],userMap=[];$.ajax({url:"data/countries.json",dataType:"json",success:function(e){for(var t=0;t<e.length;t++)countryName.push(e[t].name);countryName.sort();for(var a=0;a<countryName.length;a++)if(a%2==0){var n='<div><label class="btn btn-default color1"><input type="checkbox" value="'+countryName[a]+'">'+countryName[a]+"</label></div>";document.getElementById("countryList").innerHTML+=n}else{var o='<div><label class="btn btn-default color2"><input type="checkbox" value="'+countryName[a]+'">'+countryName[a]+"</label></div>";document.getElementById("countryList").innerHTML+=o}document.getElementById("submit").addEventListener("click",function(){for(var t=document.getElementsByTagName("input"),a=0;a<t.length;a++)if(t[a].checked)for(var n=0;n<e.length;n++)if(t[a].value===e[n].name){var o=e[n].name;userMap.push(o)}generate()})}});